import React, { Fragment } from 'react'
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const Carousel = ({value, Carouselvalue}) => {
  const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
      };
  return (
    <div>
      <Slider {...settings}>

        <img src={value.image} />

      {Carouselvalue.homeCarousel.map((item, key) =>
          <img src={item.image} />
      )}
    </Slider>
    </div>
  )
}

export default Carousel
